        const nft = $("#"+_data_.id+" .mcswap-radio-nft");
        const pnft = $("#"+_data_.id+" .mcswap-radio-pnft");
        const cnft = $("#"+_data_.id+" .mcswap-radio-cnft");
        if(core.is(":checked")){standards[0]=true;}
        if(nft.is(":checked")){standards[1]=true;}
        if(pnft.is(":checked")){standards[2]=true;}
        if(cnft.is(":checked")){standards[3]=true;}
        if(!$("#"+_data_.id+" .mcswap-refresh-button").hasClass("mcswap-rotating")){
            $("#"+_data_.id+" .mcswap-refresh-button").addClass("mcswap-rotating");
        }
