    async start(_data_,miliseconds){ 
        this.checker = setInterval(async function(){
            const provider = window.mcswap;
            if(provider && provider.isConnected && provider.isConnected === true){
                $("#"+_data_.id+" .mcswap-item").each(function(){
                    if(provider.publicKey.toString()==$(this).data("seller")){
                        if(!$(this).find(".mcswap-details-delist").is(":visible")){
                            $(this).find(".mcswap-details-delist").fadeIn(1000);
                        }
                        $(this).find(".mcswap-details-buy").prop("disabled", true);
                    }
                    else{
                        if($(this).find(".mcswap-details-delist").is(":visible")){
                            $(this).find(".mcswap-details-buy").prop("disabled", true);
                        }
                        else if($("#"+_data_.id+" ul.mcswap-item.active").length){
                            $(this).find(".mcswap-details-buy").prop("disabled", true);
                        }
                        else{
                            $(this).find(".mcswap-details-buy").prop("disabled", false);
                        }
                        $(this).find(".mcswap-details-delist").hide();
                    }
                });
            }
            else{
                $("#"+_data_.id+" .mcswap-details-delist").hide();
                $("#"+_data_.id+" .mcswap-details-buy").prop("disabled", false);
            }
        }, miliseconds);
    }
